"use strict";var alphabet="abcdefghijklmnopqrstuvwxyz234567".split("");function toHuft(addr){var parts=addr.match(/^([a-z2-7\-]+)(\.onion)?$/i);if(parts===null)throw new Error("Invalid address.");return parts[1].split("").map(function(b){return alphabet.findIndex(function(char){return char==b})}).map(function(n){return n.toString(2).padStart(5,"0")}).join("").padStart(84,"0").match(/.{1,12}/g).map(function(n){return parseInt(n,2)}).map(function(n){return w[n]}).join("-")}window.toHuft=toHuft;function toOnion(addr){return addr.split("-").map(function(word){return w.findIndex(function(val){return val==word})}).map(function(n){return n.toString(2).padStart(12,"0")}).join("").padStart(84,"0").reverse().match(/.{1,5}/g).map(function(n){return parseInt(n.reverse(),2)}).map(function(n){return alphabet[n]}).join("").reverse().slice(-16)}window.toOnion=toOnion;String.prototype.padStart=function padStart(targetLength,padString){targetLength=Math.floor(Number(targetLength));padString=String(padString||" ");if(this.length>targetLength){return String(this)}else{targetLength=targetLength-this.length;if(targetLength>padString.length){padString+=padString.repeat(targetLength/padString.length)}return padString.slice(0,targetLength)+String(this)}};String.prototype.reverse=function(){return this.split("").reverse().join("")};